import React ,{Component} from 'react'
import PathData from './Data'
import Card from './Card'

class Bg000 extends Component {
    render(){
        return(
            PathData.map((data,i) => {
                return(
                    <div className = 'bg000'>
                        <div className = 'container-types clearfix'>
                        {
                            i === 0?
                                <h3 className = 'types-title clearfix'>
                                    <span>{data.title}</span>
                                </h3>
                            :
                                <h3 className = 'types-title clearfix'>
                                    <span>{data.title}</span>
                                    <ul class="js-rank-tab">
                                        <li class="curr">实战课程</li>
                                        <li class="mianfei">免费课程</li>
                                    </ul>
                                </h3>
                        }

                            <div className = "clearfix types-content">
                                <Card 
                                    card = {data.card}
                                />
                            </div>
                        </div>
                    </div>
                )
            })
        )
    }
}

export default Bg000
